import React from 'react';

const EmojiList = () => {
  const emojis = require('emoji.json')

  return (
  <div>
    <ul>
      {
        emojis.map(emoji => <li>{emoji.char}</li> )  
      }
    </ul>
  </div>
  )
}
export default EmojiList;
